package main

import (
	"encoding/base64"
	"fmt"
	"net/http"
)

func showFavicon(w http.ResponseWriter, r *http.Request) {
    w.Header().Set("Content-Type", "image/ico")

    img, err := base64.StdEncoding.DecodeString(faviconBase64)
    if err != nil {
        pLog(LView, LError, "", err)
    }

    w.Write(img)
}

func showLogo(w http.ResponseWriter, r *http.Request) {
    w.Header().Set("Content-Type", "image/jpeg")

    img, err := base64.StdEncoding.DecodeString(logoBase64)
    if err != nil {
        pLog(LView, LError, "", err)
    }

    w.Write(img)
}

func showWebsite(w http.ResponseWriter, _ *http.Request) {
    w.Header().Set("Content-Type", "text/html")

	str := `<!doctype html>
<html>
   <head>
		<meta charset="UTF-8">
        <meta name="viewport" content="width=device-width, initial-scale=1.0">
		<title>` + engineInfo.name + `</title>
		<style>
		    :root { color-scheme: dark; }
		    body {
				font-family: monospace;
                display: flex;
                flex-direction: column;
                justify-content: center;
                align-items: center;
                height: 100vh;
                margin: 0;
			}
		</style>
	</head>
	<body>
        <img src="logo.jpg" alt="` + engineInfo.name + ` logo.">
		<p style="margin-top: .5em">` + engineInfo.desc + `</p>
		<p>
		    <strong>Source:</strong> <a href="`+ engineInfo.repo +`">GitHub</a> |
			<strong>Version:</strong> `+ engineInfo.version +` |
			<strong>License:</strong> <a href="https://spdx.org/licenses/`+engineInfo.license+`">`+ engineInfo.license + `</a>
		</p>
		</footer>
	</body>
<html>`

	fmt.Fprint(w, str)
}

